class Solution(object):
    def goodSubsetofBinaryMatrix(self, grid):
        m, n = len(grid), len(grid[0])
        best_subset = []

        for i in range(m):
            subset = [i]
            for j in range(m):
                if j != i:
                    valid = True
                    for col in range(n):
                        if sum(grid[k][col] for k in subset + [j]) > (len(subset) + 1) // 2:
                            valid = False
                            break
                    if valid:
                        subset.append(j)
            if len(subset) > len(best_subset):
                best_subset = subset
                if len(best_subset) > m // 2:  # Early stopping condition
                    break

        return best_subset
